import{_ as e,o as p,c as i,b as a}from"./app-0b91c857.js";const r={},t=a('<h3 id="项目中遇到的小问题" tabindex="-1"><a class="header-anchor" href="#项目中遇到的小问题" aria-hidden="true">#</a> 项目中遇到的小问题</h3><p>遇到 <code>TypeError: &quot;\\_vm.xxxx is not a function&quot; </code> 的报错</p><p>1、方法是否写在了 methods 内</p><p>2、检查 data 方法里返回的数据是否有和方法重名的元素</p><p>3、标签内的属性是否重复了，使用 ui 框架式多注意</p><br><hr><br><p>在使用 elementUi tag 可编辑标签渲染数据的时候，遇到了展开了其中一行其他行文本框受影响的问题</p><p>原因：每一行的文本编辑框都使用了同一个布尔值进行控制展开与隐藏</p><p>解决方法：</p><p>1、在拿到数据的同时进行循环遍历给数组添加单独的布尔值属性</p><p>2、在绑定事件的同时传入数组参数，使用展开方法的时候接收参数，修改单独的布尔值</p><br><hr><br><h3 id="vue-项目优化策略" tabindex="-1"><a class="header-anchor" href="#vue-项目优化策略" aria-hidden="true">#</a> Vue 项目优化策略</h3><ul><li><p>1、生成打包报告</p></li><li><p>2、第三方库启用 CDN</p></li><li><p>3、Element-UI 组件按需加载</p></li><li><p>4、路由懒加载</p></li><li><p>5、首页内容定制</p></li><li><p>6、跳转页面时候的进度加载 nprogress</p></li><li><p>7、发布上线 build 模式 使用 transform-remove-console 插件优化</p></li><li><p>8、chainWeback 通过链式编程的形式，来修改默认的 webpack 配置</p></li><li><p>9、configWeback 通过操作对象的形式，来修改默认的 webpack 配置</p></li></ul>',18),l=[t];function o(c,n){return p(),i("div",null,l)}const s=e(r,[["render",o],["__file","VueStudy.html.vue"]]);export{s as default};
